import React from 'react';
import { Button, Typography } from '@material-ui/core';
import './App.css';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles({
  root: {
    backgroundColor: 'red',
    color: props => props.color,
  },
  style1: {
    fontStyle: 'oblique'
  },
});

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <center><Typography variant="h2" gutterBottom className = {useStyles.style1}> Welcome to Phuyel Employment Agency! </Typography> </center>
      </header>
      <Button fullWidth variant="outlined" color="secondary"  onClick={() => history.push('/Jo')}> Explore Jobs </Button>
      <Button fullWidth variant="outlined" color="primary"> Post Job Openings </Button>
    </div>
  );
}


export default App;
